import React from 'react';

const table = props => {
    const headers = null
    return (
        <table>
            <thead>
                <tr>
                    <td>1</td>
                    <td>2</td>
                    <td>3</td>
                    <td>4</td>
                </tr>
            </thead>
        </table>
    )
};

export default table;
